+TextReplacements=(Category=Game, bIsMinimalPatch=True, Namespace="", Key="38144A7B49291FE2FBB452AFEAAFAF14", NativeString="Even if you don't hear back from us, your report helps us keep Fortnite a fair, safe, and fun game for everyone.", LocalizedStrings=(("ar","تقريرك يساعدنا في الحفاظ على إبقاء لعبة Fortnite لعبة عادلة وآمنة وممتعة للجميع."),("en","Your report helps us keep Fortnite a fair, safe, and fun game for everyone."),("de","Deine Spielermeldung hilft uns dabei, dass Fortnite für alle fair, sicher und unterhaltsam bleibt."),("es","Tu informe contribuye a que Fortnite sea un lugar justo, seguro y divertido para todo el mundo."),("es-419","Tu denuncia nos ayuda a hacer que Fortnite sea un juego justo, seguro y divertido para todos."),("fr","Votre signalement nous aide à faire de Fortnite un jeu équitable, sûr et amusant pour tous."),("it","La tua segnalazione ci aiuterà a rendere Fortnite un gioco giusto, sicuro e divertente per tutti."),("ja","通報内容はフォートナイトを公平かつ安全に誰もが楽しめるゲームにする上で役立っています。"),("ko",""),("pl","Twoje zgłoszenie pomaga nam tworzyć grę uczciwą, bezpieczną i satysfakcjonującą."),("pt-BR","Sua denúncia nos ajuda a manter o Fortnite um jogo justo, seguro e divertido para todos."),("ru","Ваши сообщения помогают нам поддерживать в Fortnite честный, безопасный и увлекательный игровой процесс."),("tr","Raporun Fortnite'ın herkes için adil, güvenli ve keyifli bir oyun olarak kalmasına yardımcı olacak."),("zh-CN","您的举报将《使堡垒之夜》为所有玩家维持一个公平、安全、有趣的游戏环境。"),("zh-Hant","您的舉報將《使堡壘之夜》為所有玩家維持一個公平、安全、有趣的遊戲環境。")))
