+TextReplacements=(Category=Game, Namespace="", Key="41F8036B4F66060533D2ACA69B6E6256", NativeString="Collect the Golden Tickets and get to the finish line! Tickets are found in Supply Drops. Collected Tickets are shared amongst the duo and only one player needs to finish for the entire duo to win!", LocalizedStrings=(("ar","ستحتاج للسرعة والذكاء لتحقيق الانتصار. اجمع التذاكر لفتح خط النهاية واعبره بسرعة وإلا ستخسر."),("en","You'll need speed and wit to take home this victory. Collect tickets to unlock the finish line and then get there quick or get left in the dust."),("de","Um hier zu gewinnen, musst du schnell sein UND clever vorgehen. Sammle genügend goldene Tickets, um das Ziel freizuschalten, und begib dich dann schnell dorthin – oder friss den Staub deiner Gegner."),("es","Necesitaréis velocidad e inteligencia para haceros con la victoria. Reunid billetes para desbloquear la línea de meta y luego dirigíos allí a toda pastilla o morderéis el polvo."),("es-419","Requerirás de velocidad e ingenio para llevarte esta victoria a casa. Reúne boletos para desbloquear la línea de meta y apresúrate en llegar o morderás el polvo."),("fr","Pour l'emporter, il vous faudra aller vite et avoir du cran. Ramassez des tickets pour déverrouiller l'arrivée, puis atteignez-la à toute vitesse si vous ne voulez pas finir dans le fossé."),("it","Avrai bisogno di velocità e astuzia per portare a casa la vittoria. Se non vuoi mordere la polvere, dovrai raccogliere i biglietti per sbloccare il traguardo e raggiungerlo in tempo."),("ja","スピードと機転を活かして勝利を呼び寄せよう。チケットを集めてゴールをアンロックし、ライバルより先にたどり着かないと負けとなってしまうぞ。"),("ko","승리를 차지하지 위해서는 속도와 센스가 중요합니다. 티켓을 충분히 수집하여 결승선을 해제하고, 빠르게 통과하지 않으면 먼지 속에 남겨질 것입니다."),("pl","To zwycięstwo będzie wymagać prędkości i sprytu. Zbieraj talony, by odblokować metę, a potem dotrzyj tam jak najszybciej lub zostań w tyle!"),("pt-BR","Você precisará de velocidade e inteligência para garantir essa vitória. Colete vales para desbloquear a linha de chegada. E é bom se apressar ou você vai comer poeira."),("ru","Перехитрить и обогнать — всё, что нужно для победы. Собирайте билеты, чтобы открыть финишную черту — пересеките её и оставьте соперников ни с чем."),("tr","Bu galibiyeti göğüslemek için hızlı davranmalı ve zeki olmalısın. Bitiş çizgisinin kilidini açmak için önce biletleri toplayıp ardından hedefe doğru çabucak ilerle yoksa rakiplerinin tozunu yutarsın."),("zh-CN","你需要速度和智慧才能获得胜利。收集门票解锁终点，然后迅速抵达终点否则会被远远抛在后面。"),("zh-Hant","你需要速度和智慧才能獲得勝利。收集門票解鎖終點，然後迅速抵達終點否則會被遠遠拋在後面。")))
