ы, чтобы открыть финишную черту — пересеките её и оставьте соперников ни с чем."),("tr","Bu galibiyeti göğüslemek için hızlı davranmalı ve zeki olmalısın. Bitiş çizgisinin kilidini açmak için önce biletleri toplayıp ardından hedefe doğru çabucak ilerle yoksa rakiplerinin tozunu yutarsın."),("zh-CN","你需要速度和智慧才能获得胜利。收集门票解锁终点，然后迅速抵达终点否则会被远远抛在后面。"),("zh-Hant","你需要速度和智慧才能獲得勝利。收集門票解鎖終點，然後迅速抵達終點否則會被遠遠拋在後面。")))
