+TextReplacements=(Category=Game, Namespace="", Key="6CB3CAB84677205AE82D8BB27D82BB5E", NativeString="Inspect_Banner_01", LocalizedStrings=(("ar","اختر فريق NFL المفضل لديك وحدد رقمك واختر نمط الواقي!"),("en","Pick your favorite NFL team, select your number, and choose your visor style!"),("de","Wähle dein NFL-Lieblingsteam, deine Nummer und deinen Visierstil aus!"),("es","¡Elegid a vuestro equipo favorito de la NFL, seleccionad un número y escoged vuestro estilo de visor!"),("es-419","¡Elige tu equipo favorito de la NFL, selecciona un número y elige un estilo de visera!"),("fr","Choisissez votre équipe de la NFL préférée, votre numéro et votre style de visière !"),("it","Scegli la tua squadre NFL preferita, il tuo numero e lo stile della visiera."),("ja","お気に入りのNFLチームを選ぼう。番号、そしてバイザーのスタイルもカスタマイズ可能！"),("ko","좋아하는 NFL팀, 번호, 얼굴 가리개 스타일을 선택하세요!"),("pl","Wybierz ulubioną drużynę NFL, numer zawodnika i osłonę hełmu!"),("pt-BR","Escolha seu time da NFL favorito, selecione um número e também um estilo de visor!"),("ru","Выберите любимую команду NFL, номер и тип шлема!"),("tr","En sevdiğin NFL takımını, forma numaranı ve kask tarzını seç!"),("zh-CN","选择你最喜欢的NFL队伍、号码和遮阳帽款式!"),("zh-Hant","選擇你最喜歡的NFL隊伍、號碼和遮陽帽款式!")))
