+TextReplacements=(Category=Game, Namespace="", Key="030F6A4E44E56191D97038A6199994C0", NativeString="One of E.G.O.'s top survivalists, Turk is on the trail of The Big One: the fish that he believes will net him the title of Top Fisherman. He especially wants to beat his rival and fellow commando, Outcast.", LocalizedStrings=(("ar","يتتبع تركي خُطى الضخم: السمكة التي يوقن أنها ستجعل لقبه أفضل صياد. يريد التغلب على خصمه وزميلته، المنبوذة."),("en","Turk is on the trail of The Big One: the fish that he believes will net him the title of Top Fisherman. He especially wants to beat his rival and fellow commando, Outcast."),("de","Turk ist auf der Spur eines ganz Großen: dem Fisch, durch den er zum besten Angler aller Zeiten wird. Dabei möchte er vor allem seine Rivalin und Kommandokollegin Angelmeisterin schlagen."),("es","Grumete va tras la pista del pez gordo, el que cree que le brindará el título de pescador supremo. Pero, por encima de todo, quiere superar a Pescadora, su rival y su compañera comando."),("es-419","Grumete le sigue la pista al grande: el pez con el que cree que pescará el título de pescador maestro. Quiere vencer a su rival y compañera de unidad, Pescadora."),("fr","Marin s'est mis en tête de pêcher un poisson légendaire grâce auquel il s'arrogera le titre de pêcheur n°1 de l'île. Un exploit qui lui permettra accessoirement de clouer le bec à Chalutière, sa rivale."),("it","Turk, è sulle tracce di Quello Grosso: il pesce che gli farà aggiudicare il titolo di Pescatore Top. Soprattutto, vuole sconfiggere la sua rivale e collega commando Reyetta."),("ja","タークは\"大物\"を追っている。釣り上げることができれば、最高の釣り人の栄誉となるだろうと考えている。特に、ライバルであり同じコマンドーであるアウトキャストには負けたくないのだ。"),("ko","터크는 거대한 목표를 쫓는 중입니다. 그에게 최고의 낚시꾼이라는 칭호를 선사해 줄 물고기죠. 특히 라이벌이자 동료 특공대원인 아웃캐스트를 이기고 싶어 합니다."),("pl","Turk tropi Wielką Rybę: zdobycz, która jego zdaniem zapewni mu tytuł Wędkarza Roku. Szczególnie zależy mu na pokonaniu rywalki i innej komandoski, Wędkarki."),("pt-BR","Turco está no rastro do Grandão: o peixe que ele acredita que o fisgará o título de Melhor Pescador. Uma de suas maiores motivações é derrotar sua rival e colega comando, Pescadora."),("ru","Рыбак находится в поисках той самой — рыбы, которая принесёт ему звание лучшего рыболова. Также он мечтает превзойти своего соперника, Рыбачку."),("tr","Balıkçı, Büyük Balık'ın peşinde. Büyük Balık'ın ona En Büyük Balıkçı unvanını kazandıracağını düşünüyor. Üstelik bunu yakalarsa Balıkçı Kız'ı da yenmiş olacağını düşünüyor."),("zh-CN","水手正在寻找\“大鱼\”：他相信这条鱼能让他获得\“顶级渔夫\”的称号。他尤其想要击败他的对手和特种兵战友——驱逐者。"),("zh-Hant","水手正在尋找\“大魚\”：他相信這條魚能讓他獲得\“頂級漁夫\”的稱號。他尤其想要擊敗他的對手和特種兵戰友——驅逐者。")))
+TextReplacements=(Category=Game, Namespace="", Key="7F13A3934B2D241A7B4E8D822D655E9B", NativeString="As one of E.G.O.'s flashiest members, Outcast has always had a knack for self-promotion. She believes that she's destined to be Top Fisherman and look fabulous while she does it... No matter what her rival, Turk, says.", LocalizedStrings=(("ar","لدى المنبوذة دائمًا اعتزاز بالنفس. تؤمن بأن مصيرها أن تكون أفضل صيادة وأن تبدو رائعة أثناء القيام بهذا... ولا يهم ما يقوله منافسها تركي."),("en","Outcast has always had a knack for self-promotion. She believes that she's destined to be Top Fisherman and look fabulous while she does it... No matter what her rival, Turk, says."),("de","Die Angelmeisterin konnte sich schon immer gut verkaufen. Sie ist überzeugt, dass sie zur besten Anglerin aller Zeiten wird – und dabei auch noch gut aussehen kann. Ganz egal, was ihr Rivale Turk davon hält."),("es","A Pescadora le encanta el autobombo. Tiene la firme creencia de que el destino le depara el título de pescadora suprema y de que lo ostentará como una diva... Por más que Grumete, su rival, afirme lo contrario."),("es-419","Pescadora siempre ha tenido un don para la autopromoción. Cree que está destinada a conseguir el título de pescador maestro y luce fabulosa mientras lo hace... Sin importar lo que diga Grumete, su rival."),("fr","Chalutière a toujours adoré se mettre en avant. Elle est convaincue que son destin est de devenir le pêcheur n°1 de l'île, et ce, peu importe ce qu'en dit son rival, Marin."),("it","Reyetta ha sempre avuto un talento per il protagonismo. Crede di essere destinata a ottenere il titolo di Pescatore Top e a riuscirci in gran stile... Indipendentemente da quel che dice il suo rivale, Turk."),("ja","アウトキャストは常に自己主張をしたがる。彼女は、自分こそが最高の釣り人となる運命にあることを信じており、それ成し遂げる時には羨望の目で見られるに違いないと思っている… ライバルのタークが何を言おうとも。"),("ko","아웃캐스트는 예전부터 자기 홍보 실력이 뛰어났습니다. 최고의 낚시꾼이 되는 동시에 멋들어진 모습도 유지할 수 있을 거라 믿고 있죠... 라이벌인 터크가 뭐라든 신경 쓰지 않습니다."),("pl","Wędkarka zawsze miała dryg do autopromocji. Jest przekonana, że zdobędzie tytuł Wędkarza Roku i będzie przy tym świetnie wyglądać... bez względu na to, co mówi na ten temat jej rywal, Turk."),("pt-BR","A Pescadora sempre levou jeito para a autopromoção. Ela acredita que o título de Melhor Pescador deveria ser dela, afinal, está no nome! E não importa o que seu rival, Turco, diz."),("ru","Рыбачка всегда умела хорошо себя преподнести. Девушка считает, что заслуживает звание лучшего рыболова, а рыбу она ловит просто изумительно. Мнение соперника, Рыбака, её совершенно не волнует."),("tr","Balıkçı Kız, her zaman kendini tanıtmayı başarır. En İyi Balıkçı olmanın kaderinde olduğuna inanır ve bu yolda tarzından ödün vermez... Rakibi Balıkçı ne derse desin..."),("zh-CN","驱逐者在自我宣传方面一直很有一套。她相信自己注定是顶级渔夫，并且在实现这一目标的过程中做得棒……“不管她的对手是谁”，水手说。"),("zh-Hant","驅逐者在自我宣傳方面一直很有一套。她相信自己註定是頂級漁夫，並且在實現這一目標的過程中做得棒……“不管她的對手是誰”，水手說。")))
+TextReplacements=(Category=Game, Namespace="", Key="8A01D73949C825C4635915881F8F69EE", NativeString="After E.G.O.'s collapse, Remedy became a freelance medic who uses her unparalleled medical abilities on the battlefield to even the scales. She's got a strong survival instinct and an even stronger sense of justice.", LocalizedStrings=(("ar","ريميدي هي طبيبة مستقلة تستخدم قدرتها الطبية التي لا مثيل لها في أرض المعركة حتى تحقق التوازن. لديها غريزة صمود قوية وكذلك حس أقوى بالعدالة."),("en","Remedy is a freelance medic who uses her unparalleled medical abilities on the battlefield to even the scales. She's got a strong survival instinct and an even stronger sense of justice."),("de","Genesung ist eine selbstständige Sanitäterin, die mit ihren unvergleichlichen medizinischen Fähigkeiten jede Schlacht beeinflussen kann. Ihr Überlebensinstinkt ist stark ausgeprägt, aber nicht so sehr wie ihr Sinn für Gerechtigkeit."),("es","Cura es una doctora autónoma que usa sus incomparables habilidades médicas para equilibrar la balanza en el campo de batalla. Posee un fuerte instinto de supervivencia y un sentido de la justicia aún más férreo."),("es-419","Cura es una doctora independiente que usa sus habilidades médicas sin iguales en el campo de batalla para equilibrar la balanza. Tiene un fuerte instinto de supervivencia y un sentido de la justicia aún más fuerte."),("fr","Panacée est une infirmière libérale qui emploie ses connaissances médicales pour prendre le dessus au combat. Son instinct de survie n'est supplanté que par son sens de la justice."),("it","Rimedio è una dottoressa mercenaria che usa le sue ineguagliabili competenze mediche sul campo di battaglia per pareggiare i conti. Il suo istinto di sopravvivenza è molto forte, ma il suo senso della giustizia lo è ancora di più."),("ja","レメディはフリーランスの医療班。比類なき医療の才能で活躍し、戦局を変えることすらできる。彼女は生存本能に優れており、正義感も非常に強い。"),("ko","프리랜서 의무병 레메디는 누구도 따라올 수 없는 의료 실력을 발휘해 전장의 균형을 유지합니다. 대단한 생존 본능과 엄청난 정의감의 소유자이기도 합니다."),("pl","Medyk do wynajęcia Odtrutka korzysta ze swych niezrównanych zdolności lekarskich, by wyrównać siły stron. Ma silny instynkt przetrwania i jeszcze silniejsze poczucie sprawiedliwości."),("pt-BR","A Medicina é uma médica autônoma que usa suas habilidades médicas incomparáveis no campo de batalha para equilibrar a balança entre o bem e o mal. Ela tem um forte instinto de sobrevivência e um senso de justiça ainda mais forte."),("ru","Анестезия — врач-фрилансер. Она использует свои поразительные врачебные способности на поле боя, чтобы сравнять счёт. У неё невероятно сильный инстинкт выживания и обострённое чувство справедливости."),("tr","Pansuman, dengeyi sağlamak için eşsiz iyileştirme becerilerini savaş alanında kullanan serbest bir sıhhiyeci. Çok iyi hayatta kalma becerisine sahip ve adalet isteği kimsenin gerisinde kalmaz."),("zh-CN","救护者是一名自由医务人员，她在战场上利用自己无与伦比的医疗能力平衡了天平。她有很强的生存本能和更强的正义感。"),("zh-Hant","救護者是一名自由醫務人員，她在戰場上利用自己無與倫比的醫療能力平衡了天平。她有很強的生存本能和更強的正義感。"))
