+TextReplacements=(Category=Game, Namespace="", Key="9793C88C44901EAB4261878BBD6F7E2A", NativeString="Unlock the exclusive J Balvin style for Party Trooper by attending the Afterlife Party!", LocalizedStrings=(("ar","تتفاعل زينة الظهر الحلوى اللاذعة مع عمليات التصفية!"),("en","Bitter Sweets Back Bling reacts to eliminations!"),("de","Das Rücken-Accessoire „Kampfkeks“ reagiert auf Eliminierungen!"),("es","¡El accesorio mochilero Agridulce reacciona a las eliminaciones!"),("es-419","¡La mochila retro Agridulce reacciona a las eliminaciones!"),("fr","L'accessoire de dos Biscuit bougon réagit aux éliminations !"),("it","Il dorso decorativo Dolci amari reagisce alle eliminazioni!"),("ja","バックアクセサリー「ビタースウィート」は撃破に反応する！"),("ko","적을 처치하면 '화난 쿠키' 등 장신구가 반응합니다!"),("pl","Plecak Gorzkie Łakocie reaguje na likwidacje!"),("pt-BR","O Acessório para as Costas Agridoces reage a eliminações!"),("ru","Украшение на спину «Имбирный щит» меняет вид после устранений!"),("tr","Acı Şekerler sırt süsü avlamalara tepki gösterir!"),("zh-CN","苦涩糖果背部装饰会对淘汰作出反应！"),("zh-Hant","苦澀糖果背部裝飾會對淘汰作出反應！")))
+TextReplacements=(Category=Game, Namespace="", Key="D6E638B346C2B3701C9B0A93DF6C7ABD", NativeString="Unlock the exclusive J Balvin style now and attend the Afterlife show in Party Royale!", LocalizedStrings=(("ar","انضم إلى جوقة مع لاعبين آخرين يستخدمون رقصة غنوا معي!"),("en","Join a chorus with other players who are using the Sing Along emote!"),("de","Singe gemeinsam mit anderen Spielern, die das Emote „Alle mitsingen“ einsetzen!"),("es","¡Uníos al coro formado por los jugadores que estén usando el gesto Canta!"),("es-419","¡Forma un coro con otros jugadores que usen el gesto Canta!"),("fr","Chantez en chœur avec les autres joueurs qui utilisent l'emote Chorale !"),("it","Unisciti al coro con gli altri giocatori che stanno usando l'emote Canta insieme!"),("ja","エモート「共に歌う」を使っているプレイヤーと一緒にコーラスしよう！"),("ko","다른 플레이어들과 같이 '함께 부르는 노래' 이모트를 사용하면 함께 노래를 부를 수 있습니다!"),("pl","Dołącz do chóru graczy, którzy również używają emotki Śpiewaj Razem!"),("pt-BR","Solte sua voz com outros jogadores que estão usando o Gesto Canta Comigo!"),("ru","Пойте вместе с другими игроками, которые используют эмоцию «Поём хором»!"),("tr","Masal Şarkısı ifadesi kullanan diğer oyuncularla koro oluştur!"),("zh-CN","和其他使用“跟着唱”姿势的玩家组成合唱！"),("zh-Hant","和其他使用“跟著唱”姿勢的玩家組成合唱！")))
